import React, { useRef } from 'react';
import {
  View,
  Text,
  Image,
  TouchableOpacity,
  StyleSheet,
  Animated,
  Dimensions,
  Platform,
} from 'react-native';

const { width } = Dimensions.get('window');

const ProjectCard = ({ project, index }) => {
  const scaleAnim = useRef(new Animated.Value(1)).current;
  const glowAnim = useRef(new Animated.Value(0)).current;

  const handlePressIn = () => {
    Animated.parallel([
      Animated.spring(scaleAnim, {
        toValue: 1.05,
        useNativeDriver: true,
      }),
      Animated.timing(glowAnim, {
        toValue: 1,
        duration: 200,
        useNativeDriver: true,
      }),
    ]).start();
  };

  const handlePressOut = () => {
    Animated.parallel([
      Animated.spring(scaleAnim, {
        toValue: 1,
        useNativeDriver: true,
      }),
      Animated.timing(glowAnim, {
        toValue: 0,
        duration: 200,
        useNativeDriver: true,
      }),
    ]).start();
  };

  return (
    <TouchableOpacity
      activeOpacity={0.9}
      onPressIn={handlePressIn}
      onPressOut={handlePressOut}
    >
      <Animated.View
        style={[
          styles.projectCard,
          {
            transform: [{ scale: scaleAnim }],
          },
        ]}
      >
        <View style={styles.cardImageContainer}>
          <Image
            source={{ uri: project.image }}
            style={styles.cardImage}
            resizeMode="cover"
          />
          <View style={styles.imageOverlay} />
        </View>

        <View style={styles.cardContent}>
          <View style={styles.cardHeader}>
            <Text style={styles.cardTitle}>{project.title}</Text>
          </View>

          <Text style={styles.cardDescription}>{project.description}</Text>

          <View style={styles.techStack}>
            {project.tech.map((tech, idx) => (
              <View key={idx} style={styles.techBadge}>
                <Text style={styles.techText}>{tech}</Text>
              </View>
            ))}
          </View>

          <View style={styles.impactContainer}>
            <Text style={styles.impactText}>{project.impact}</Text>
          </View>
        </View>
      </Animated.View>
    </TouchableOpacity>
  );
};

const ProjectsSection = () => {
  const projects = [
    {
      id: 1,
      title: 'AI Supply Chain Optimization',
      description: 'Eliminated delays with smart logistics. Real-time tracking, predictive analytics, and automated vendor management.',
      image: 'https://via.placeholder.com/400x300/8B0000/FF4500?text=AI+SUPPLY',
      tech: ['Python', 'TensorFlow', 'React'],
      impact: 'Increased efficiency by 300%',
    },
    {
      id: 2,
      title: 'Golf Group Management App',
      description: 'Streamlined recreational group management. Tee time booking, score tracking, and social features for golf enthusiasts.',
      image: 'https://via.placeholder.com/400x300/FF4500/000000?text=GOLF+APP',
      tech: ['React Native', 'Firebase', 'Node.js'],
      impact: 'Boosted engagement by 250%',
    },
    {
      id: 3,
      title: 'Pet Grooming Platform',
      description: 'Comprehensive booking and operations platform. Complete scheduling system with customer management.',
      image: 'https://via.placeholder.com/400x300/FFA500/000000?text=PET+CARE',
      tech: ['Next.js', 'PostgreSQL', 'Stripe'],
      impact: 'Revenue increased by 400%',
    },
    {
      id: 4,
      title: 'Startup Development Platform',
      description: 'From concept to revenue through custom applications. Full-stack development for emerging businesses and MVPs.',
      image: 'https://via.placeholder.com/400x300/FFD700/000000?text=STARTUP',
      tech: ['Vue.js', 'AWS', 'MongoDB'],
      impact: 'Time to market reduced by 60%',
    },
    {
      id: 5,
      title: 'ChatBot for ECS Advising',
      description: 'Utilizing vector embeddings and LLMs to bridge the knowledge gap between an overworked advising staff and students.',
      image: 'https://via.placeholder.com/400x300/8A2BE2/FFFFFF?text=ADVISING+BOT',
      tech: ['Python', 'LangChain', 'Next.js'],
      impact: 'Reduced advisor workload by 40%',
    },
    {
      id: 6,
      title: 'DietAI: AI Powered Calorie Tracker',
      description: 'Assisted in mobile bug fixes which led to a 7 figure PE acquisition.',
      image: 'https://via.placeholder.com/400x300/32CD32/FFFFFF?text=DIETAI',
      tech: ['React Native', 'Firebase', 'Python'],
      impact: 'Led to a 7-figure acquisition',
    },
  ];

  return (
    <View style={styles.container}>
      <Text style={styles.sectionTitle}>OUR PROJECTS</Text>
      <View style={styles.fireBar} />

      <Text style={styles.sectionSubtitle}>
        Proven solutions that deliver measurable results
      </Text>

      <View style={styles.projectsGrid}>
        {projects.map((project, index) => (
          <ProjectCard key={project.id} project={project} index={index} />
        ))}
      </View>

      <TouchableOpacity style={styles.viewAllButton}>
        <Text style={styles.viewAllText}>VIEW ALL PROJECTS</Text>
        <Text style={styles.viewAllArrow}>â†’</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#F5F5F5',
    paddingVertical: 80,
    paddingHorizontal: width > 768 ? 40 : 20,
    borderTopWidth: 1,
    borderTopColor: '#EEEEEE',
  },
  sectionTitle: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 36 : 24,
    color: '#1A1A1A',
    textAlign: 'center',
    marginBottom: 20,
    fontWeight: '700',
  },
  fireBar: {
    height: 4,
    width: 80,
    backgroundColor: '#00A8E8',
    alignSelf: 'center',
    marginBottom: 20,
    borderRadius: 2,
  },
  sectionSubtitle: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 14,
    color: '#333333',
    textAlign: 'center',
    marginBottom: 50,
  },
  projectsGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: 30,
    maxWidth: 1200,
    alignSelf: 'center',
  },
  projectCard: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    borderWidth: 1,
    borderColor: '#EEEEEE',
    overflow: 'hidden',
    width: width > 768 ? 500 : width - 40,
    position: 'relative',
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 4,
    },
    shadowOpacity: 0.1,
    shadowRadius: 10,
    elevation: 5,
  },
  cardGlow: {
    display: 'none',
  },
  cardImageContainer: {
    position: 'relative',
    height: 200,
    overflow: 'hidden',
  },
  cardImage: {
    width: '100%',
    height: '100%',
  },
  imageOverlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.3)',
    ...Platform.select({
      web: {
        background: 'linear-gradient(180deg, transparent 0%, rgba(0, 0, 0, 0.6) 100%)',
      },
    }),
  },
  cardContent: {
    padding: 20,
  },
  cardHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 15,
  },
  cardTitle: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 14,
    color: '#1A1A1A',
    fontWeight: '700',
    flex: 1,
  },
  cardDescription: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: 14,
    color: '#333333',
    lineHeight: 24,
    marginBottom: 20,
  },
  techStack: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    gap: 8,
    marginBottom: 20,
  },
  techBadge: {
    backgroundColor: '#E8F7FB',
    paddingHorizontal: 12,
    paddingVertical: 6,
    borderRadius: 4,
    borderWidth: 1,
    borderColor: '#00A8E8',
  },
  techText: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: 11,
    color: '#00A8E8',
    fontWeight: '600',
  },
  impactContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 168, 232, 0.1)',
    padding: 12,
    borderRadius: 6,
    borderLeftWidth: 3,
    borderLeftColor: '#00A8E8',
  },
  impactText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 13,
    color: '#00A8E8',
    fontWeight: '700',
  },
  viewAllButton: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 50,
    paddingVertical: 15,
    paddingHorizontal: 30,
    backgroundColor: 'transparent',
    borderWidth: 2,
    borderColor: '#00A8E8',
    borderRadius: 8,
    alignSelf: 'center',
  },
  viewAllText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 14,
    color: '#00A8E8',
    marginRight: 10,
    fontWeight: '600',
  },
  viewAllArrow: {
    fontSize: 20,
    color: '#00A8E8',
  },
});

export default ProjectsSection;
